"""

TLE in leetcode
"""
class Solution:
    def subarraysDivByK(self, A, K):
        """
        :type A: List[int]
        :type K: int
        :rtype: int
        """
        if not A:
            return 0
        acc = [A[0]]
        for i in range(1, len(A)):
            acc.append(acc[-1]+A[i])
        res = 0
        for i in range(-1, len(A)):
            for j in range(i+1, len(A)):
                start = acc[i] if i >= 0 else 0
                end = acc[j]
                if (end - start) % K == 0:
                    res += 1                
        return res 

